import React from "react";
import "./PlayerCard.css";

function PlayerCard(type) {
  return (
    <div className="playerCard">
      <div className="badge">
        <div className="badgeWrapper">
          <div className="right">
            <p className="productName">
              {/* {type === "pinned"
                ? "Pinned"
                : type === "category"
                ? "category"
                : ""} */}
              Lebron James
            </p>
            {/* {type === "pinned" ? (
              <span className={stockCount}> 300 items in stock</span>
            ) : (
              ""
            )} */}
            <p className="position">Power forward</p>
          </div>
          <div className="left">
            {type === "pinned" ? (
              <img src="/icons/boost.svg" alt="" className="boostIcon" />
            ) : type === "category" || type === "product" ? (
              <img
                src="/icons/whiteChevron.svg"
                alt=""
                className="whiteChevron"
              />
            ) : (
              ""
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default PlayerCard;
